import React from 'react'
import './navbar.css'
import logo from '../../assets/img/logo.svg'
import { NavLink } from 'react-router-dom'
import { useDispatch, useSelector } from 'react-redux'
import { logout } from '../../reducers/userReducer'

function Navbar() {
  const isAuth = useSelector(state => state.user.isAuth)
  const dispatch = useDispatch()

  return (
    <div className='navbar'>
        <div className="container">
            <img src={logo} alt='' className='navbar__logo'/>
            <div className='navbar__header'>Cloud Storage</div>
            {!isAuth && <div className='navbar__login'><NavLink className='link link__login' to="/login">Login</NavLink></div> }
            {!isAuth && <div className='navbar__registration'><NavLink className='link link__registration' to="/registration">Registration</NavLink></div> }
            {isAuth && <div className='navbar__login' onClick={() => dispatch(logout())}>Exit</div> }
        </div>
    </div>
  )
}

export default Navbar
